const e=JSON.parse('{"key":"v-75ad3751","path":"/nice-article/weixin/xiecjavasmmjyoc.html","title":"携程Java三面面经，已OC！！","lang":"zh-CN","frontmatter":{"title":"携程Java三面面经，已OC！！","shortTitle":"携程Java三面面经，已OC！！","description":"携程的面试难度一般，效率比较高，面试体验还是不错的。","author":"Guide","category":["微信公众号"],"head":[["meta",{"property":"og:url","content":"https://javabetter.cn/nice-article/weixin/xiecjavasmmjyoc.html"}],["meta",{"property":"og:site_name","content":"二哥的Java进阶之路"}],["meta",{"property":"og:title","content":"携程Java三面面经，已OC！！"}],["meta",{"property":"og:description","content":"携程的面试难度一般，效率比较高，面试体验还是不错的。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-02-27T11:41:47.000Z"}],["meta",{"property":"article:author","content":"Guide"}],["meta",{"property":"article:modified_time","content":"2023-02-27T11:41:47.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"携程Java三面面经，已OC！！\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-02-27T11:41:47.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"Guide\\"}]}"]]},"headers":[{"level":2,"title":"一面（45min）","slug":"一面-45min","link":"#一面-45min","children":[]},{"level":2,"title":"二面（50min）","slug":"二面-50min","link":"#二面-50min","children":[]},{"level":2,"title":"HR面","slug":"hr面","link":"#hr面","children":[]},{"level":2,"title":"英语测评","slug":"英语测评","link":"#英语测评","children":[{"level":3,"title":"参考资料","slug":"参考资料","link":"#参考资料","children":[]}]}],"git":{"createdTime":1677498107000,"updatedTime":1677498107000,"contributors":[{"name":"沉默王二","email":"www.qing_gee@163.com","commits":1}]},"readingTime":{"minutes":5.43,"words":1628},"filePathRelative":"nice-article/weixin/xiecjavasmmjyoc.md","localizedDate":"2023年2月27日","excerpt":"<p>你好，我是 Guide。今天来分享一位读者携程校招 Java 岗位的面经。</p>\\n<p>下面是正文。</p>\\n<p>个人背景：双非本，机械专业转码。</p>\\n<p>携程在正式面试之前，会有一个性格测试（40分钟）。性格测试之后，大概过一周进行笔试。笔试之后，会邮件通知是否通过并预约第一轮面试时间。</p>\\n<p>普通 offer 一般只有两面，如果是 sp 或者 ssp 的话，技术面貌似是三面。</p>\\n<p>携程的面试难度一般，效率比较高，面试体验还是不错的。</p>\\n<h2> 一面（45min）</h2>\\n<p>主要是问八股，难度较低。</p>\\n<ol>\\n<li>自我介绍；</li>\\n<li>进程和线程的区别；</li>\\n<li>并行和并发的区别；</li>\\n<li><code>synchronized</code> 的作用；</li>\\n<li><code>synchronized</code> 和 <code>ReentrantLock</code> 的区别，如何选择；</li>\\n<li><code>ThreadLocal</code> 使用过程中可能存在的问题（内存泄露）；</li>\\n<li><code>ThreadLocal</code> 内存泄露问题是怎么导致的；</li>\\n<li>项目中是如何创建线程池的，什么不用<code>Executors</code> 去创建线程池；</li>\\n<li>知道的本地缓存，选择 Caffeine 的原因；</li>\\n<li>Redis 这类缓存和 Caffeine 的区别；</li>\\n<li>Redis 中常见的数据结构，应用场景；</li>\\n<li>缓存穿透和缓存雪崩的区别，解决办法；</li>\\n<li>MySQL 和 Redis 怎么保持数据一致；</li>\\n<li>一个 SQL 笔试题，join 多表查询（共享屏幕）。</li>\\n</ol>"}');export{e as data};
